    return this.configuredMinResource;
  }
  if (!p.hasConfiguredMinCapacity()) {
    return null;
  }
  this.configuredMinResource = convertFromProtoFormat(
      p.getConfiguredMinCapacity());
  return this.configuredMinResource;
}
